import React, { useState, useEffect } from 'react';
import { Modal, Card, Typography, Button } from '@material-ui/core';
import './DoctorDetails.css'; // Import your DoctorDetails CSS file

const DoctorDetails = ({ open, handleClose, doctor }) => {
  const [doctorDetails, setDoctorDetails] = useState();

  useEffect(() => {
    setDoctorDetails(doctor);
  }, []);

  return (
    <Modal open={open} onClose={handleClose}>
      <Card className="doctor-details-card" style={{ position: 'absolute', width: "300px", top: '50%', left: '50%', transform: 'translate(-50%, -50%)', padding: '20px' }}>
        <div className="card-header">
          <Typography variant="h5">Doctor Details</Typography>
        </div>
        <div className="card-content">
          {/* <Typography variant="subtitle1">Doctor's Name: {doctor.name}</Typography>
          <Typography variant="subtitle1">Total Experience: {doctor.experience}</Typography>
          <Typography variant="subtitle1">Speciality: {doctor.speciality}</Typography>
          <Typography variant="subtitle1">Date of Birth: {doctor.dateOfBirth}</Typography>
          <Typography variant="subtitle1">City: {doctor.city}</Typography>
          <Typography variant="subtitle1">Email: {doctor.email}</Typography>
          <Typography variant="subtitle1">Mobile: {doctor.mobile}</Typography>
          <Typography variant="subtitle1">Rating: {doctor.rating}</Typography> */}
          <Typography variant="subtitle1">Doctor's Name: Raman Rao</Typography>
          <Typography variant="subtitle1">Total Experience:</Typography>
          <Typography variant="subtitle1">Speciality:</Typography>
          <Typography variant="subtitle1">Date of Birth:</Typography>
          <Typography variant="subtitle1">City:</Typography>
          <Typography variant="subtitle1">Email:</Typography>
          <Typography variant="subtitle1">Mobile:</Typography>
          <Typography variant="subtitle1">Rating:</Typography>
        </div>
      </Card>
    </Modal>
  );
};

export default DoctorDetails;
